import React from 'react';
import '../Css/PolicyStyle.css'
const Policy=()=>{
    return(
        <>
        <div className="policy">
            <h1>Kebijakan Privasi</h1>
            <ol>
        <li>
        Kebijakan Privasi ini menjelaskan:
        • Informasi apa yang kami kumpulkan dan mengapa kami kumpulkan.
        • Bagaimana kami menggunakan informasi itu.
        • Pilihan yang kami tawarkan, termasuk cara mengakses dan memperbarui informasi. Kami telah mencoba untuk membuat kebijakan ini sesederhana mungkin tetapi jika Anda memiliki pertanyaan, silakan hubungi kami di humas@ganeshaoperation.com
        </li>
       
            </ol>
        </div>
       
        </>
    )
}
export default Policy;
